    false,nt"url": null,nt"notes": "This narrative report for Seney National
    Wildlife Refuge outlines Refuge accomplishments from August through October of 1941.
    The report begins by summarizing the weather conditions and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    predators, rodents, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments and plantings. The public relations section
    of the report describes recreational uses, Refuge visitors, hunting, violations,
    and fishing. N-R forms and photographs are attached. A report on field investigations
    and applied research is included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
